met de stemmen van Andy Samberg, Cheryl Hines en Patrick Warburton

Chimpansee Ham III, kleinzoon van Ham, de beroemde aap die als eerste de ruimte in ging, gaat samen met zijn maatje met een 
ruimteschip de ruimte in. Ze komen terecht op een vreemde planeet waar ze een avontuur beleven om de inwoners te redden van een 
wrede leider.
